#include <stdio.h>


// "Hello, World" 
size_t strlen(const char* str) {
	const char* count = str;
	while (*count++);
	return count - str - 1; 
}


// 平移开头 
// 123456 -> 561234 
// 时间复杂度 O(n+p)，空间复杂度 O(p) 
void function(char* str, const int p) {
	char str2[p + 1];
	int head = 0;
	int len = strlen(str);
	
	// 123456 -> 123456 -> 563456 -> 561234
	for (int i = 0; i <= p; i++) str2[i] = str[i];
	for (int i = p + 1; i < len; i++) str[head++] = str[i];
	for (int i = head; i < len; i++) str[i] = str2[i-head];

}

// ab -> ab -> bb -> ba
void swap(char *a, char *b) {
	int temp = *a;
	*a = *b;
	*b = temp;
}

// 算法复杂度 O(n/2) 
void reverse(char* str, int a, int b) {
	int times = (b - a + 1) / 2;
	while (times--) {
		swap(&str[a+times], &str[b-times]);
	}
}

// 或者三次 reverse
// 123456 -> 432156 -> 432165 -> 561234
// 时间复杂度 O(n)，空间复杂度 O(1) 
void function2(char* str, const int p) {
	reverse(str, 0, 3);
	reverse(str, 4, 5);
	reverse(str, 0, 5);
}

 
int main() {
	// char str[] = "";
	function2(str, 3);
	printf("%s", str);
	
	return 0;
}
